    def popup_icon_chooser(self):
        """
        :return: Any(str, None) Returns hex string of color chosen or None if nothing was chosen
        """

        button_size = (1, 1)

        # button_size = (None,None)         # for very compact buttons

        def IconButton(icon):
            """
            A User Defined Element - returns a Button that configured in a certain way.
            :param color: Tuple[str, str] ( color name, hex string)
            :return: sg.Button object
            """
            return sg.B(
                image_data=icon[1],
                pad=(0, 0),
                size=button_size,
                key=icon,
                tooltip=f"{icon[0]}",
                border_width=0,
            )

        num_icons = len(list(self.icon_map.keys()))
        row_len = 10

        grid = [
            [
                IconButton(list(self.icon_map.items())[c + j * row_len])
                for c in range(0, row_len)
            ]
            for j in range(0, num_icons // row_len)
        ]
        grid += [
            [
                IconButton(
                    list(self.icon_map.items())[c + num_icons - num_icons % row_len]
                )
                for c in range(0, num_icons % row_len)
            ]
        ]

        layout = (
            [[sg.Text("Pick an icon", font="Def 18")]]
            + grid
            + [[sg.Button("OK"), sg.T(size=(30, 1), key="-OUT-")]]
        )

        window = sg.Window(
            "Icon Chooser",
            layout,
            no_titlebar=True,
            grab_anywhere=True,
            keep_on_top=True,
            use_ttk_buttons=True,
        )
        icon_chosen = None
        while True:  # Event Loop
            event, values = window.read()
            if event in (sg.WIN_CLOSED, "OK"):
                if event == sg.WIN_CLOSED:
                    icon_chosen = None
                break
            window["-OUT-"](f"You chose {event[0]} : {event[1]}")
            icon_chosen = event[0]
        window.close()
        return icon_chosen
